import React from 'react';
import styled from 'styled-components';

const SearchBarContainer = styled.div`
  position: absolute;
  bottom: 100px;
  left: 50%;
  transform: translateX(-50%) rotate(90deg);
  z-index: 10;
`;

const SearchBar = styled.div`
  border-radius: 54px;
  background: rgba(27, 83, 35, 0.30);
  background: color(display-p3 0.1702 0.3208 0.1595 / 0.30);
  backdrop-filter: blur(10.100000381469727px);
  width: 310px;
  height: 56px;
  flex-shrink: 0;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 20px;
  box-sizing: border-box;
`;

const SearchText = styled.span`
  color: #fff;
  font-family: 'Pretendard', sans-serif;
  font-size: 16px;
  font-weight: 400;
  text-align: center;
`;

const CircularButton = styled.button`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background: rgba(255, 255, 255, 0.2);
  border: none;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-right: 5px;
  transition: all 0.2s ease;

  &:hover {
    background: rgba(255, 255, 255, 0.3);
    transform: scale(1.05);
  }

  &:active {
    transform: scale(0.95);
  }
`;

const ButtonIcon = styled.div`
  width: 20px;
  height: 20px;
  background: #fff;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 12px;
  color: #1b5323;
  font-weight: bold;
`;

const WeatherSearch = ({ onSearchClick }) => {
  const handleSearchClick = () => {
    if (onSearchClick) {
      onSearchClick();
    } else {
      console.log('Search button clicked');
    }
  };

  return (
    <SearchBarContainer>
      <SearchBar>
        <SearchText>ÎÇ†Ïî®Î•º ÏûÖÎ†•Ìï¥ Î≥¥ÏÑ∏Ïöî.</SearchText>
        <CircularButton onClick={handleSearchClick}>
          <ButtonIcon>üîç</ButtonIcon>
        </CircularButton>
      </SearchBar>
    </SearchBarContainer>
  );
};

export default WeatherSearch;
